function executeRun(n,t,i){$.ajax({url:"/HTMLExamples/Run",type:"POST",data:JSON.stringify(n),contentType:"application/json",headers:{"X-CSRF-TOKEN":t},success:function(n){i.setAttribute("srcdoc",n.htmlContent)},error:function(n){for(let t=0;t<n.responseJSON.errors.HTMLContent.length;t++)Toastify({text:n.responseJSON.errors.HTMLContent[t],style:{background:"red"},duration:3e3,newWindow:!0,gravity:"top",position:"right"}).showToast()}})}function executeCheckOriginal(n,t){$.ajax({url:"/HTMLExamples/CheckWithOriginal",type:"POST",data:JSON.stringify(n),contentType:"application/json",headers:{"X-CSRF-TOKEN":t},success:function(n){n?Toastify({text:"The same as original one.",duration:3e3,newWindow:!0,gravity:"top",position:"right"}).showToast():Toastify({text:"Different from the original one.",duration:3e3,newWindow:!0,gravity:"top",position:"right"}).showToast()},error:function(n,t,i){Toastify({text:i,style:{background:"red"},duration:3e3,newWindow:!0,gravity:"top",position:"right"}).showToast()}})}function executeEdit(n,t){$.ajax({url:"/HTMLExamples/Edit",type:"POST",data:JSON.stringify(n),contentType:"application/json",headers:{"X-CSRF-TOKEN":t},success:function(n){n&&Toastify({text:"Successfully Edited.",style:{background:"green"},duration:3e3,newWindow:!0,gravity:"top",position:"right"}).showToast()},error:function(n){for(let t=0;t<n.responseJSON.errors.HTMLContent.length;t++)Toastify({text:n.responseJSON.errors.HTMLContent[t],style:{background:"red"},duration:3e3,newWindow:!0,gravity:"top",position:"right"}).showToast()}})}